import React from 'react';
import { Link, useMatch, useResolvedPath } from "react-router-dom"
import { NavLink, useLocation } from 'react-router-dom';


export default function Navbar() {
  const matchSearch = useMatch('/search');
  const matchFavorites = useMatch('/favorites');

  const location = useLocation();

  return (
    <nav class="navbar navbar-expand-lg">
      <div class="collapse navbar-collapse justify-content-end" id="navbarNav">
        <ul class="navbar-nav">
          <li class="nav-item">
            <Link
              to="/search"
              class={`nav-link ${location.pathname === '/search' ? 'active border border-white' : ''}`}
              style={{textDecoration: 'none', color: 'white', border: '1px solid transparent', borderRadius: '12px'}}
              onMouseOver={(e) => e.target.style.border = '1px solid white'}
              onMouseOut={(e) => e.target.style.border =  '1px solid transparent'}Out={(e) => e.target.style.border = matchSearch ? '1px solid white' : '1px solid transparent'}
            >
              Search
            </Link>
          </li>
          <li class="nav-item">
            <Link
              to="/favorites"
              class={`nav-link ${location.pathname === '/favorites' ? 'active border border-white' : ''}`}
              style={{textDecoration: 'none', color: 'white', border: '1px solid transparent', borderRadius: '12px'}}
              onMouseOver={(e) => e.target.style.border = '1px solid white'}
              onMouseOut={(e) => e.target.style.border =  '1px solid transparent'}
            >
              Favourites
            </Link>
          </li>
        </ul>
      </div>
    </nav>
  );
}
